import React, { Component } from "react";

class Signup extends Component{
    render(){
        return(
            <div>
                <form onSubmit={this.props.handleSubmit}>

                    <input type="submit" value="Submit" onClick={()=> {this.props.handleSubmit()}} />
                </form>
            </div>
        )
    }
}

export default Signup
